import { Card3Container, CardText } from "../Styles/Card.style";
import { Card } from "./Card";

const cards = [
  {
    title: "   Hydra||Dynmo",
    color: "#130e2d",
  },
  {
    title: "Get Out",
    color: "#130e2d",
  },
];

export const Card3 = () => {
  return (
    <>
      {cards.map((card) => (
        <Card3Container style={{ backgroundColor: card.color }}>
          <CardText>{card.title}</CardText>
        </Card3Container>
      ))}
    </>
  );
};
